import React from 'react';
import { Header, Menu, Divider } from 'semantic-ui-react';

class Portfolio extends React.Component {
  render(){
    return (
      <div className='portfolio'>
        <h4></h4>
        <Menu borderless={true} floated='right'>
          <Menu.Item>
            <Header as='h4' disabled={true}>Portfolio</Header>
          </Menu.Item>
          <Menu.Item>
            <Header as='h4' >Transactions</Header>
          </Menu.Item>
        </Menu>
      </div>
    )
  };
};

export default Portfolio;
